function NewExpenseItem(props) {
  return (
    <div>
      <ExpenseItem
        title={prexpenses[0].title}
        amount={prexpenses[0].amount}
        date={prexpenses[0].date}
      />
      <ExpenseItem
        title={prexpenses[1].title}
        amount={prexpenses[1].amount}
        date={prexpenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={prexpenses[2].title}
        amount={prexpenses[2].amount}
        date={prexpenses[2].date}
      />
      <ExpenseItem
        title={prexpenses[3].title}
        amount={prexpenses[3].amount}
        date={prexpenses[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default NewExpenseItem;
